package com.asiainfo

import java.io.{BufferedReader, FileReader}
import java.util

import com.asiainfo.log.AppLog
import main.com.asiainfo.CommonInterface.util.CommonUtil

object ExtracterUtil {
  def extract(logPath: String) = {
    val reader = new BufferedReader(new FileReader(logPath))
    var sqlBody = ""
    var sqlCount = 1
    var paraCount = 0
    val paraArray = new util.ArrayList[String]
    //val fullSqls = new util.ArrayList[String]()
    var fullSql = ""

    var line = reader.readLine()

    while (line != null) {
      AppLog.logger.debug(line)
      while (!line.contains("where") && !line.contains("insert into")) {
        line = reader.readLine()
        if (line == null) {
          System.exit(0)
        }
      }
      AppLog.logger.debug("original line===>" + line)
      if (line.contains("select")) {

        if (line.contains(" | [")) {
          sqlBody = line.substring(line.indexOf("select"), line.indexOf(" | ["))
        } else {
          sqlBody = line.substring(line.indexOf("select"))
        }

        sqlBody = sqlBody.replace("?", "%s")

      } else if (line.contains("update") && !line.contains("WARN")) {

        sqlBody = line.substring(line.indexOf("update"), line.indexOf(" | ["))
        sqlBody = sqlBody.replace("?", "%s")

      } else if (line.contains("insert into") && line.contains(" | [")) {

        sqlBody = line.substring(line.indexOf("insert into"), line.indexOf(" | ["))
        sqlBody = sqlBody.replace("?", "%s")

      }

      AppLog.logger.debug("sqlBody===>" + sqlBody)
      paraCount = CommonUtil.countOfString(sqlBody, "%s")
      AppLog.logger.debug("paraCount===>" + paraCount)

      var paraLine = reader.readLine()
      if (paraLine.contains("Batch Parameters:")) {
        AppLog.logger.debug("Index: " + paraLine.indexOf("/") )
        /*Batch Parameters: 1/5*/
        sqlCount = paraLine.substring(paraLine.indexOf("/") + 1 ).toInt;
        AppLog.logger.debug("sql count: " + sqlCount )
        if(sqlCount > 5 ) {
          sqlCount = 5
        }

      }
      if( paraCount > 0) {
        for (i <- 0 until sqlCount) {

          while (!paraLine.startsWith("(1)")) {
            AppLog.logger.debug(paraLine)
            paraLine = reader.readLine()
          }

          for (j <- 0 until paraCount) {
            if (!paraLine.contains("null")) {
              val parameter = paraLine.substring(paraLine.indexOf("[") + 1, paraLine.indexOf("]"))
              paraArray.add(parameter)
            } else {
              paraArray.add("null")
            }
            paraLine = reader.readLine()
          }

          fullSql = formatSql(sqlBody, paraArray, paraCount)

          if (fullSql != "")
            AppLog.logger.info("Obtained sql " + i + "====>\t" + fullSql + ";")
          fullSql = ""
          paraArray.clear()
        }
      }
      paraCount = 0
      sqlBody = ""
      sqlCount = 1
      line = reader.readLine()

    }
  }
